import React from 'react';

const Game = (props) => {
    const { game } = props
    return (
        <div>
            <p>Game Name: {game.title}</p> 
            <p>Game Price:{game.price}</p>
            <p>Game Description:{game.description}</p>
            <p>Game Price:{game.price}</p>
        </div>
    )
}



export default Game;
